// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.16 <0.9.0;
// 
import "openzeppelin-solidity/contracts/math/SafeMath.sol";
import "./DolToken.sol";

contract Exchange {
    using SafeMath for uint256; //uint256subadd
    // 
    address public feeAccount;
    uint256 public feePercent; // 
    mapping(address => mapping(address => uint256)) public tokens;
    address constant ETHER = address(0);
// 
struct _Order {
    uint256 id;
    address createUser;
    address tokenFrom;
    uint256 amountFrom;
    address tokenTo;
    uint256 amountTo;
    uint256 timestamp;
    uint16 status; //012
}
// _Order[] orderList;//
mapping(uint256 => _Order) public orders; //maping
uint256 public orderCount; //
event Order(
    uint256 id,
    address createUser,
    address tokenFrom,
    uint256 amountFrom,
    address tokenTo,
    uint256 amountTo,
    uint256 timestamp
);
    event Cancel(
        uint256 id,
        address createUser,
        address tokenFrom,
        uint256 amountFrom,
        address tokenTo,
        uint256 amountTo,
        uint256 timestamp
    );
    event Trade(
        uint256 id,
        address createUser,
        address tokenFrom,
        uint256 amountFrom,
        address tokenTo,
        uint256 amountTo,
        uint256 timestamp
    );

    constructor(address _feeAccount, uint256 _feePercent) {
        feeAccount = _feeAccount;
        feePercent = _feePercent;
    }

    event Deposit(address token, address user, uint256 amount, uint256 balance);
    event WithDraw(
        address token,
        address user,
        uint256 amount,
        uint256 balance
    );

    // 
    function depositEther() public payable {
        // payablemsg.sendermsg.value,
        tokens[ETHER][msg.sender] = tokens[ETHER][msg.sender].add(msg.value);
        emit Deposit(ETHER, msg.sender, msg.value, tokens[ETHER][msg.sender]);
    }

    // 
    function depositToken(address _token, uint256 _amount) public {
        // _token_amount
        require(_token != ETHER);
        // address(this)msg.sender
        require(
            DolToken(_token).transferFrom(msg.sender, address(this), _amount)
        );
        // 
        tokens[_token][msg.sender] = tokens[_token][msg.sender].add(_amount);
        emit Deposit(_token, msg.sender, _amount, tokens[_token][msg.sender]);
    }

    // 
    function balanceOf(
        address _token,
        address _user
    ) public view returns (uint256) {
        return tokens[_token][_user];
    }

    // 
    function withdrawEther(uint256 _amount) public {
        // 
        require(tokens[ETHER][msg.sender] >= _amount);
        // 
        tokens[ETHER][msg.sender] = tokens[ETHER][msg.sender].sub(_amount);
        // payable_amount
        payable(msg.sender).transfer(_amount);
        // WithDraw
        emit WithDraw(ETHER, msg.sender, _amount, tokens[ETHER][msg.sender]);
    }

    // 
    function withdrawToken(address _token, uint256 _amount) public {
        // _token_amount
        require(_token != ETHER);
        // 
        require(tokens[_token][msg.sender] >= _amount);
        // 
        tokens[_token][msg.sender] = tokens[_token][msg.sender].sub(_amount);
        // transfermsg.sender
        require(DolToken(_token).transfer(msg.sender, _amount));
        // WithDraw
        emit WithDraw(_token, msg.sender, _amount, tokens[_token][msg.sender]);
    }

    // 
    function makeOrder(
        address _tokenFrom,
        uint256 _amountFrom,
        address _tokenTo,
        uint256 _amountTo
    ) public {
        require(balanceOf(_tokenFrom, msg.sender) >= _amountFrom,unicode'');
        orderCount = orderCount.add(1);
        orders[orderCount] = _Order(
            orderCount,
            msg.sender,
            _tokenFrom,
            _amountFrom,
            _tokenTo,
            _amountTo,
            block.timestamp,
            0
        );
        // 
        emit Order(
            orderCount,
            msg.sender,
            _tokenFrom,
            _amountFrom,
            _tokenTo,
            _amountTo,
            block.timestamp
        );
    }

    // 
    function cancelOrder(uint _id) public {
        _Order memory myorder = orders[_id];
        require(myorder.id == _id);
        require(myorder.createUser == msg.sender);
        // 
        orders[_id] = _Order(
            myorder.id,
            myorder.createUser,
            myorder.tokenFrom,
            myorder.amountFrom,
            myorder.tokenTo,
            myorder.amountTo,
            myorder.timestamp,
            2
        );//
        // 
        emit Cancel(
            myorder.id,
            myorder.createUser,
            myorder.tokenFrom,
            myorder.amountFrom,
            myorder.tokenTo,
            myorder.amountTo,
            block.timestamp
        );//
    }

    // 
    function fillOrder(uint _id) public {
        _Order memory myorder = orders[_id];
        require(myorder.id == _id);
        // msg.sender
        // &
        require(
            _trade(
                myorder.createUser,
                myorder.tokenFrom,
                myorder.amountFrom,
                myorder.tokenTo,
                myorder.amountTo,
                msg.sender
            )
        );
        // todo 
        // 
        orders[_id] = _Order(
            myorder.id,
            myorder.createUser,
            myorder.tokenFrom,
            myorder.amountFrom,
            myorder.tokenTo,
            myorder.amountTo,
            myorder.timestamp,
            1
        );
        emit Trade(
            myorder.id,
            msg.sender,
            myorder.tokenFrom,
            myorder.amountFrom,
            myorder.tokenTo,
            myorder.amountTo,
            block.timestamp
        );//
    }

    // 
    function _trade(
        address _createUser,
        address _tokenFrom,
        uint256 _amountFrom,
        address _tokenTo,
        uint256 _amountTo,
        address _fillUser
    ) internal returns (bool) {
        // 
        uint256 feeAmount = _amountTo.mul(feePercent).div(100);
        // 
        require(balanceOf(_tokenFrom, _createUser) >= _amountFrom,unicode'');
        require(balanceOf(_tokenTo, _fillUser) >= _amountTo.add(feeAmount),unicode'');
        // todo
        // 
        tokens[_tokenFrom][_createUser] = tokens[_tokenFrom][_createUser].sub(
            _amountFrom
        );
        tokens[_tokenTo][_createUser] = tokens[_tokenTo][_createUser].add(
            _amountTo
        );
        // 
        tokens[_tokenFrom][_fillUser] = tokens[_tokenFrom][_fillUser].add(
            _amountFrom
        );
        tokens[_tokenTo][_fillUser] = tokens[_tokenTo][_fillUser].sub(
            _amountTo.add(feeAmount)
        ); //
        // 
        tokens[_tokenTo][feeAccount] = tokens[_tokenTo][feeAccount].add(
            feeAmount
        );
        return true;
    }
}
